import React from 'react';
import "./Hero.css";

function Hero () {
    return (
      <div className='hero'>
        <div className='container'>
          <div className='row'>
            <div className='col'> This is from hero area</div>
            <div className='col'> This is from hero area</div>
          </div>
        </div>
      </div>
    );
}
export default Hero;
